import React, {Component} from 'react';

import Image from 'react-bootstrap/Image';
import { Button, Navbar } from 'react-bootstrap';
import './navbar.css';

class Nav extends Component {


    // constructor(props) {
    //   super(props)

    //   // this.state = {socialTransfers:null}
    // }

    render() {

    return (
        <div>
          <Navbar className="navbar__container">
            <div className="navbar__links">
                <img src="/assets/logo-cci.svg" />
                <a href='/'>Beetroots</a>
                <a href='/'>Horseraddish</a>
                <a href='/'>Sea lettuce</a>
            </div>
            <Button variant="success">Start Building for Free</Button>
          </Navbar>
      </div>
    );
  } 
}


export default Nav;
